  "title": {
    "nb": "Digital 3D-bymodell for deler av Trondheim kommune"
  },
  "description": {
    "nb": "Trondheim kommune etablerte i 2014 en digital 3D-bymodell for et område på ca 36 km2 i og rundt sentrum av byen. Trondheim 3D Bymodell er en digital gjengivelse av Trondheim kommune i form av en større 3D-modell basert på informasjon fra kartdata (FKB-A/B), laserdata og ortofoto fra 2014 samt skråbilder fra 2013 og gatebilder fra 2014 (noen utvalgte områder). Modellen er basert på følgende programvareversjoner: 3ds Max Design 2014, Forest Pro 4.3.6 og Unity 4. Koordinatsystem er EUREF89 UTM Sone32 og høydesystem er NN2000.Modellen består av: Terreng (basert på laser og kartdata), Vegetasjon (basert på laser), Bygg (et utvalg av disse er teksturert fra bilder, resten fra skråbilder), andre oppstikkende objekter fra kartdata, 3D-modeller bl.a. Olav Tryggvasons statue, Bybroa og Tyholttårnet, kommunedekkende 3D-modell og høyspentnett. Modellen er levert til Trondheim kommune i tre former: Visualiseringsmodell, eksportmodell og VR-modellHer er noen eksempler på aktuelle bruksområder:Stillbilder, skisser/fotorealisme, årstidsvariasjoner, dag/natt, animasjoner/filmer, presentasjonsverktøy, vise forskjellige scenarier, sol/skyggeforhold, sikt/synlighet, bilder til rapporter.Vi velger i denne omgang å publisere bymodellen som en 3D-Studio-Max prosjektfil (med alle nødvendige tilhørende filer) og som VR-modell. OPPDATERING (16.02.2016): Etter å ha fått en del tilbakemeldinger på publisering av datasettene, legger vi nå ut disse på flere formater.Grunnen til at vi først valgte å legge ut 3d-bymodellen bare på proprietært format, var at den ikke ble etablert med tanke på offentliggjøring. Vi jobber med å se på bedre måter å generere 3d-modeller som er enklere å dele.Vi legger ut følgende:1. Zipfil som inneholder 3ds Max-prosjektfiler (Trondheim_bymodell.zip) av Trondheim bymodell som både er avhengige og uavhengige av Forest pack og V-RAY. Den originale modellen benytter tredjeparts plugins for trær og materialer. De nye prosjektfilene er delvis eller helt uavhengig av disse.2. Zipfil som inneholder Trondheim VR-modell (VR-modell Trondheim.zip).3. Zipfil som inneholder Trondheim VR-modell som er tilrettelagt for Mac (Trondheim.app.zip).4. Zipfil som inneholder terreng og bygg fra bymodellen som 3ds-filer (Trondheim_3ds.zip). På grunn av måten materialer er mappet på bygningene i 3ds Max, vil bildematerialer som følger eksportfiler - som 3ds-filer - utgjøre veldig store datamengder. Vi velger derfor i denne omgang å legge ut bare geometrien. Vi legger også ut ortofotofilene som er brukt i den originale bymodellen. Disse kan brukes til å teksturere/tilegne materialer på terreng og tak.På nedlastningssiden kan du nå se størrelsen på de nedlastbare filene. "
  },
