  "title": {
    "nb": "Helsestatistikk fra Folkehelseinstituttet"
  },
  "description": {
    "nb": "Folkehelseinstituttet har to statistikkbanker med data om helsetilstand, sykdom, behandling, risikofaktorer, fødsel og aborter, helsetjenester og sosial ulikhet i helse. Norgeshelsa statistikkbank har data som er tilrettelagt for landet, helseregioner og fylker. Kommunehelsa statistikkbank har data som er tilrettelagt for kommuner.Data er fordelt på kjønn, aldersgrupper, år og geografiske områder. Norgeshelsa statistikkbank byr på totalt 80 emner, cirka 20 emner handler om sosial ulikhet i helse. Data er hentet fra sentrale helseregistre, helseundersøkelser, Statistisk sentralbyrå og flere andre kilder, blant annet Helsedirektoratet, Universitetet i Bergen og Arbeids- og velferdsetaten (NAV). I statistikkbanken er data tilrettelagt med aldersstandardisering slik at det kan gjøres sammenlikninger mellom år og geografiske områder. Data kan lastes ned som exceltabeller, og vil i nye versjoner også kunne lastes ned i andre format.Norgeshelsa statistikkbank oppdateres fortløpende.Kommunehelsa statistikkbank har færre emner og oppdateres i januar hvert år. Statistikkbanken er knyttet til utarbeidelse av folkehelseprofiler. Du finner full indikatorliste og metadata i statistikkbankene. "
  },
  "descriptionFormatted": {
    "nb": "\u003cp\u003eFolkehelseinstituttet har to statistikkbanker med data om helsetilstand, sykdom, behandling, risikofaktorer, fødsel og aborter, helsetjenester og sosial ulikhet i helse. Norgeshelsa statistikkbank har data som er tilrettelagt for landet, helseregioner og fylker. Kommunehelsa statistikkbank har data som er tilrettelagt for kommuner.\u003c/p\u003e\u003cp\u003eData er fordelt på kjønn, aldersgrupper, år og geografiske områder. Norgeshelsa statistikkbank byr på totalt 80 emner, cirka 20 emner handler om sosial ulikhet i helse. Data er hentet fra sentrale helseregistre, helseundersøkelser, Statistisk sentralbyrå og flere andre kilder, blant annet Helsedirektoratet, Universitetet i Bergen og Arbeids- og velferdsetaten (NAV). I statistikkbanken er data tilrettelagt med aldersstandardisering slik at det kan gjøres sammenlikninger mellom år og geografiske områder. Data kan lastes ned som exceltabeller, og vil i nye versjoner også kunne lastes ned i andre format.\u003c/p\u003e\u003cp\u003eNorgeshelsa statistikkbank oppdateres fortløpende.\u003c/p\u003e\u003cp\u003eKommunehelsa statistikkbank har færre emner og oppdateres i januar hvert år. Statistikkbanken er knyttet til utarbeidelse av folkehelseprofiler. Du finner full indikatorliste og metadata i statistikkbankene.\u003c/p\u003e\u003cp\u003e \u003c/p\u003e"
