  "description": {
    "nb": "Et vannområde er administrativ inndeling for forvaltning av vann og vassdrag, inkludert grunnvannsforekomster og kystnære marine områder. Vannområde er en underinndeling under vannregion. Flere vannområder utgjør en vannregion. \nInndelingen bygger på inndelingskriteringer fra vannforskriften, som implementerer EUs vannrammedirektiv (Water Framework Directive). Norge er inndelt i totalt 106 vannområder. Vannområdegrensene følger ikke eksakt kommunegrenser og heller ikke de eksakte nedslagsfeltene."
