  "title": {
    "nb": "Administrative enheter fylker 2019"
  },
  "description": {
    "nb": "Datasettet administrative enheter viser fylkesinndelingen i landet med de mest nøyaktige grenser som er registrert digitalt og som er samlet i ett datasett. Fylkene er avgrenset av riksgrense, territorialgrense, avgrensningslinje i sjø og fylkesgrense. I tillegg inneholder datasettet grunnlinje og 1 nautisk mil, som er juridiske linjer utenfor kysten. Enhetene inneholder egenskaper som forteller om offisielle fylkesnumre. De offisielle norske og samiske navnene for fylker er hentet fra SSR. I tillegg finnes informasjon om samiske forvaltningsområder. Geometrien er avledet fra matrikkelen, som blir ajourført av kommunene. Riksgrense og territorialgrense er lagt inn fra Kartverkets egne etablerte filer."
  },
