  "title": {
    "nb": "Landskap i ruter"
  },
  "description": {
    "nb": "Den enkle strukturen i modellen gjør det mulig å gjennomføre en rekke ulike landskapsanalyser, for eksempel å teste hypoteser om aspekter ved landskapskarakter og landskapsendringer. Det er flere presentasjons- og analysemuligheter, deriblant analyser for gruppering av ruter som har lignende kombinasjoner av dataverdier. Ved å generalisere informasjon til rutenettet slik det er gjort her, får man et overordnet datasett der lokale detaljer nedprioriteres til fordel for de overordnede trendene."
  },
