  "title": {
    "nb": "Arealressurskart - AR250 - Arealtyper"
  },
  "description": {
    "nb": "Kartlag i det landsdekkende datasettet AR250 som viser hovedtyper av arealessurser i målestokk 1:250 000 og er tilpasset bruk i målestokker fra 1:100 000 til 1:300 000. Arealtype er en inndeling i åtte arealressursklasser. Egenskap/kolonne i datasettet som skal brukes til å fremstille kartlaget heter ARTYPE. AR250 fremstilt ved en generalisering av AR5 under tregrensa, og tolking av satellittbilder over tregrensa. I tillegg har det vært benyttet N50 der vi verken har hatt AR5 eller satellittbilder. Figurer som er mindre enn 100 dekar vises ikke på kartet, men blir slått sammen med tilgrensende områder. Datasettet oppdateres en gang hvert tredje år med siste års versjon av FKB-AR5 (Arealressurskart i målestokk 1:5000 i databasen pr. 31.12). Siste oppdatering har data fra 31.12.2013. Data lastes ned som fylkesvise eller kommunevise filer."
  },
