  "title": {
    "nb": "INSPIRE Cadastral parcels"
  },
  "description": {
    "nb": "The INSPIRE Directive focuses on the geographical part of cadastral data In the INSPIRE context cadastral parcels will be mainly used as locators for geo information in general including environmental data \nAs much as possible in the INSPIRE context cadastral parcels should be forming a partition of national territory Cadastral parcel should be considered as a single area of Earth surface under homogeneous real property rights and unique ownership adapted from UN ECE 2004 and WG CPI 2006 Remark By unique ownership is meant that the ownership is held by one or several owners for the whole parcel By homogeneous property rights is meant that rights of ownership leases and mortgages affect the whole parcel This does not apply to specific rights as servitudes which may only affect part of the parcel"
  },
