  "description": {
    "nb": "Datasettet avgrenser siidaer i det samiske reinbeiteområdet. En siida er en gruppe av reineiere som utøver reindrift i fellesskap på bestemte arealer. Det finnes sommersiidaer og vintersiidaer. De siste årene har det vært i underkant av 100 sommersiidaer, og om lag 150 vintersiidaer i det samiske reinbeiteområdet. En siida består av en eller flere siidaandeler, hvor hver siidaandel har en ansvarlig leder."
  },
