  "title": {
    "nb": "Flom aktsomhetsområder"
  },
  "description": {
    "nb": "NVEs aktsomhetskart for flom er et nasjonalt kart på oversiktsnivå som viser hvilke arealer som kan være utsatt for flomfare. Kartet vil aldri kunne bli helt nøyaktig, men er godt nok til å gi en indikasjon på hvor flomfaren bør vurderes nærmere, dersom det er aktuelt med ny utbygging. Informasjonen i kartet kan benyttes som et første vurderingsgrunnlag i konsekvensutrednings- og/eller risiko- og sårbarhetsanalyser tilknyttet kommuneplanen og for å identifisere potensielle fareområder for flom. De potensielle fareområdene kan legges til grunn ved fastsetting av flomhensynssoner og planbestemmelser."
  },
