  "description": {
    "nb": "I henhold til Skogbruksloven § 12, anses skog som vernskog når den tjener til vern for annen skog eller gir vern mot naturskader. Det samme gjelder områder opp mot fjellet eller ut mot havet der skogen er sårbar og kan bli ødelagt ved feil skogbehandling.\n\nDet er Fylkesmannens landbruksavdeling har ansvar for kartlegging av vernskoggrensene. Vernskog er samlet inn og er tilgjengelig for de områdene hvor data er sendt inn digitalt av Fylkesmannens landbruksavdelingen."
