  "title": {
    "nb": "Nasjonal marin verneplan - Rådgivende utvalgs A-liste"
  },
  "description": {
    "nb": "Datasettet viser de 36 første områdene som er foreslått å inngå i nasjonal marin verneplan for Norge.\n\n I mai 2001 ble det opprettet et rådgivende utvalg som har kommet med forslag om hvilke områder som bør inngå i verneplanen. Områdene som er foreslått til planen er særegne områder eller leveområder som er typiske for kysten vår. Sammen skal de danne et nettverk av vernede og beskyttede områder for å ta vare på økosystemer og naturverdier. Første fase av marin verneplan er konsentrert rundt områder som er beskrevet i Rådgivende utvalgs A-liste, som omfatter totalt 36 områder."
  },
