  "title": {
    "nb": "Mulighet for marin leire"
  },
  "description": {
    "nb": "Datasettet Mulighet for marin leire (MML) er basert på løsmassekart (kvartærgeologiske kart) i ulik målestokk og datasett for marin grense. Datasettet er opprettet som en hjelp til å lese et kvartærgeologisk kart. Løsmassetyper under marin grense er klassifisert etter muligheten for å finne marin leire og kan grovt sett inndeles i seks klasser.\n\nDet er viktig å påpeke at datasettet ikke viser ny informasjon i forhold til det kvartærgeologiske kartet. Det er også viktig at man sjekker hvilken målestokk kartleggingen har foregått i, og det bør også tas høyde for at marin grense stedvis kan være beheftet med noe usikkerhet. Blant annet derfor er polygoner, som krysser eller ligger nær marin grense, tatt med i klassifiseringen. Imidlertid viser en skravur hvilken del av disse polygoner som ligger over marin grense, og som det derfor generelt kan ses bort fra mht mulighet for marin leire. Unntak vil være områder der andre løsmasser ligger oppå marin leire, men da vil sistnevnte kun finnes under marin grensenivået. Les mer om MML samt kartapplikasjon inklusive bruk og usikkerheter ved å trykke på lenken \u0027Vis produktside\u0027 øverst."
  },
