  "title": {
    "nb": "Arealressurskart - FKB-AR5 - Treslag"
  },
  "description": {
    "nb": "Kartlag i det landsdekkende datasettet AR5 som viser treslag i målestokk 1:5000. Datasettet dekker alle områder under skoggrensen. Datasettet er tilpasset bruk i målestokker fra 1:5000 til 1:20 000. AR5 er avledet fra tidligere markslag i Økonomisk kartverk.Treslag gir informasjon om hovedklasser av skogtyper. Egenskap/kolonne som skal brukes til å fremstille kartlaget heter ARTRESLAG. Areal mindre enn to dekar blir vanligvis ikke skilt ut som egen figur. Jordbruksareal skilles ut ned til 0,5 dekar. Kravet for stedfestingsnøyaktighet er to meter. Areal i kvadratmeter er oppført under AREA_C. Datasettet oppdateres en gang i året med siste års versjon av FKB-AR5 (Arealressurskart i målestokk 1:5000 i databasen pr. 31.12). Data lastes ned kommunevis."
  },
