  "title": {
    "nb": "Jordsmonn"
  },
  "description": {
    "nb": "Datasettet Jordsmonn inneholder kartlag som viser fordelingen av ulike jordtyper, jordkvalitet, erosjonsrisiko , driftstekniske begrensninger og potensialet for dyrking av korn, gras og potet. Rundt halvparten av Norges fulldyrka og overflatedyrka jord er jordsmonnskartlagt, med hovedvekt på Sør-Østlandet, Trøndelag og Jæren. På enkelte steder er også også innmarksbeite kartlagt. Kartlaget er fremstilt i målestokk 1:5000 og er tilpasset bruk i målestokker fra 1:5000 til 1:20 000."
  },
