  "description": {
    "nb": "N500 Raster er en gjengivelse av temaene i N500 Kartdata og har en presentasjon som så langt mulig er lik N250 Raster. N500 Raster dekker fastlands-Norge og er begrenset av riksgrensen mot nabolandene og territorialgrensen i havet. N500 Raster baserer seg på N500 Kartdata og distribueres ukentlig. N500 Raster på GeoTiFF-format leveres tile-vis i områder 2 grader Ø-V og 1 grad N-S. \nFølgende referansefiler medfølger: SOSI og TFW"
  },
