  "title": {
    "nb": "Jordsmonn - Driftstekniske begrensninger"
  },
  "description": {
    "nb": "Kartlag i datasettet Jordsmonn som viser enkelte jordsmonnegenskapers begrensende innvirkning på bruken av jorda. Kartlaget viser begrensninger i fire klasser basert på jordsmonnegenskaper i kombinasjon med terrengegenskapene helling, mengde stein og blokk på overflata samt frekvens av\nfjellblotninger. Egenskap som skal brukes til å fremstille kartlaget heter JR_DRIFT. Rundt halvparten av Norges fulldyrka og overflatedyrka jord er jordsmonnskartlagt, med hovedvekt på Sør-Østlandet, Trøndelag og Jæren. På enkelte steder er også også innmarksbeite kartlagt. Kartlaget er fremstilt i målestokk 1:5000 og er tilpasset bruk i målestokker fra 1:5000 til 1:20 000. Geografisk objekt er jordtype."
  },
  "descriptionFormatted": {
    "nb": "Kartlag i datasettet Jordsmonn som viser enkelte jordsmonnegenskapers begrensende innvirkning på bruken av jorda. Kartlaget viser begrensninger i fire klasser basert på jordsmonnegenskaper i kombinasjon med terrengegenskapene helling, mengde stein og blokk på overflata samt frekvens av\nfjellblotninger. Egenskap som skal brukes til å fremstille kartlaget heter JR_DRIFT. Rundt halvparten av Norges fulldyrka og overflatedyrka jord er jordsmonnskartlagt, med hovedvekt på Sør-Østlandet, Trøndelag og Jæren. På enkelte steder er også også innmarksbeite kartlagt. Kartlaget er fremstilt i målestokk 1:5000 og er tilpasset bruk i målestokker fra 1:5000 til 1:20 000. Geografisk objekt er jordtype."
  },
